This book has an interest in straightforward performant programming. We're not going to go into the depths of comparing sorting algorithms and time complexities. Instead, my recommendation is to make use of Python's built-in methods for lists. The Python team has spent time optimising these. For instance, list.sort() uses "Timsort", invented by Tim Peters (who also wrote the famous Zen of Python ). import random random_numbers = [random.randint(1, 1000) for _ in range(100)] random_numbers.sort() print("Sorted list using sorted():", sorted_numbers)
print("Sorted list using sort():", random_numbers) Similarly, take the case of searching for an item, with the aim of returning the index. In Python, you can use the .index() method, which is highly optimised and has a worst case time complexity of O(n). It's only worth implementing something like binary search, which is O(log n), if the list is already sorted, as otherwise you'll be incurring the sorting cost too. import random random_numbers = [random.randint(1, 100) for _ in range(100)] try: index = random_numbers.index(42) print("There is a 42 at index", index)
except ValueError: print("42 is not in the list.")
